import './ModelX.css'
import modelxback from './teslaimg/pic.jfif'
import HeaderPage from './HeaderPage'
const ModelX = () => {
    return ( 
        <div>
        <HeaderPage
        title="Model X"
        background={modelxback}
        description="Hyper"
        range="500km"
        time="4.1s"
        speed="270km/h"
        horsepower="1,120hp"
        first
     /></div>
     );
}
 
export default ModelX;
